class State:
    def __init__(self, positions, tickets):
        self.positions = positions
        self.tickets = tickets
    
    def result(self, action):
        tickets = self.tickets[:] # Cpia dos bilhetes do estado atual

        for t in action.ticketsUsed:
            tickets[t] -= 1 # Descontar os bilhetes usados para ir para a nova posio

        return State(action.newPositions, tickets)

class Action:
    def __init__(self, ticketsUsed, newPositions):
        self.ticketsUsed = ticketsUsed
        self.newPositions = newPositions

class Node:
    count = 0

    def __init__(self, problem, state, parent, action, pathCost):
        self.problem = problem
        self.state = state
        self.parent = parent
        self.action = action
        self.pathCost = pathCost
        self.totalCost = self.calculateTotalCost()

    def expand(self):
        Node.count += 1
        children = []
        for action in self.problem.getPossibleActions(self.state):
            children.append(self.childNode(action))
        return children

    def childNode(self, action):
        return Node(
            self.problem,
            self.state.result(action),  # Novo estado
            self,                       # O pai do filho  o prprio n
            action,                     # Ao usada para gerar o filho
            self.pathCost + 1)          # O novo custo  o custo deste n + 1
    
    def goalHeuristic(self, goal):
        distances = [self.problem.distances[self.state.positions[i]][goal[i]] for i in range(self.problem.numPolicemen)]

        # Heurstica: se houver polcias no goal e outros a 1 de distncia, retornar 2
        has = [False, False]
        for d in distances:
            if d < 2:
                has[d] = True
        if has[0] and has[1]:
            return 2
        else:
            return max(distances)

    def _calculateTotalCost(self):
        # f(n) =   g(n)      +        h(n)
        return self.pathCost + self.goalHeuristic(self.problem.goal)

    def _calculateTotalCost_ao(self):
        goals = [list(goal) for goal in permutations(self.problem.goal, self.problem.numPolicemen)]
        goalMaxDistances = []
        for goal in goals: # Calcular a distncia do polcia que est mais longe do seu objetivo
            goalMaxDistances.append(self.goalHeuristic(goal))
        
        estimatedDistance = min(goalMaxDistances)

        return self.pathCost + estimatedDistance

    def tracebackPath(self):
        if self.parent:
            return self.parent.tracebackPath() + [[self.action.ticketsUsed, self.state.positions]]
        return [[self.action.ticketsUsed, self.state.positions]]

class Frontier:
    def __init__(self, initialSize, initialNode):
        self.mainList = []
        for _ in range(initialSize):
            self.mainList.append([])
        self.mainList[initialNode.totalCost].append(initialNode)
        self.lowerBound = initialNode.totalCost
        self.upperBound = initialSize - 1
        
    def insert(self, node):
        if node.totalCost > self.upperBound:
            for _ in range(node.totalCost - self.upperBound):
                self.mainList.append([])
            self.upperBound = node.totalCost
                
        self.mainList[node.totalCost].append(node)
    
    def pop(self):
        while not self.mainList[self.lowerBound]:
            self.lowerBound += 1
            if self.lowerBound > self.upperBound:
                return None
        return self.mainList[self.lowerBound].pop(-1)

def aStar(problem): # A*
    frontier = Frontier(MAX_HEURISTIC, Node(problem, problem.initialState, None, problem.initialAction, 0))
    
    while True:
        node = frontier.pop()
        if (not node) or (node.pathCost > problem.limitdepth):
            return []
        if problem.isGoal(node.state):
            return node.tracebackPath()
        if Node.count < problem.limitexp:
            for child in node.expand():
                if Node.count < problem.limitexp:
                    frontier.insert(child)
        

class SearchProblem:
    def __init__(self, goal, model, auxheur = []):
        self.goal = goal
        self.transitions = model
        self.numVertices = len(self.transitions) - 1
        self.distances = DISTANCES

    def search(self, init, limitexp = 2000, limitdepth = 10, tickets = [math.inf, math.inf, math.inf], anyorder = False):
        self.initialState = State(init, tickets) # Estado inicial (posies, bilhetes)
        self.initialAction = Action([], init) # Ao inicial
        self.numPolicemen = len(init) # N de polcias
        self.anyorder = anyorder # Se interessa ou no que polcia est em cada posio objetivo
        self.limitexp = limitexp
        self.limitdepth = limitdepth

        if anyorder:
            Node.calculateTotalCost = Node._calculateTotalCost_ao
        else:
            Node.calculateTotalCost = Node._calculateTotalCost

        return aStar(self)

    def getPossibleActions(self, state):
        # Guardar as aes que cada polcia pode fazer
        actionsByPoliceman = [self.transitions[pos] for pos in state.positions]

        # Lista de combinaes possveis de aes no formato ([transporte1, pos1], [transporte2, pos2], ...) 
        # Ex.: ([0, 20], [1, 36], [0, 37])
        moveCombinations = list(product(*actionsByPoliceman))

        def validTickets(comb):
            ticketsCopy = state.tickets[:]
            for move in comb: # Descontar os bilhetes usados
                ticketsCopy[move[0]] -= 1
                if ticketsCopy[move[0]] < 0: # Se forem usados mais bilhetes de um tipo
                    return False             # do que aqueles que existem, a ao  invlida
            return True

        def validPositions(comb):
            i = 0
            j = 1
            while i < self.numPolicemen - 1:
                if comb[i][1] == comb[j][1]: # Dois polcias querem ir para a mesma 
                    return False             # posio -> Ao invlida
                j += 1
                if j == self.numPolicemen:
                    i += 1
                    j = i + 1
            return True
        
        # Remover as aes invlidas
        validMoveCombinations = []
        for comb in moveCombinations:
            if validTickets(comb) and validPositions(comb):
                validMoveCombinations.append(comb)

        # Lista de aes no formato Action([transporte1, transporte2, ...], [pos1, pos2, ...])
        # Ex.: ([0, 1, 0], [20, 36, 37])
        possibleActions = [Action(
            [move[0] for move in comb],
            [move[1] for move in comb])
            for comb in validMoveCombinations]
        
        return possibleActions
    
    def isGoal(self, state):
        if self.anyorder:
            for p in permutations(self.goal, self.numPolicemen):
                if state.positions == list(p):
                    return True
            return False
        return state.positions == self.goal